import React from 'react'
import {StyledWrapper,ItemCount,ShoppingIcon} from './styles.js'

const CartIcon = () => {
  return (
    <StyledWrapper>
      <ShoppingIcon />
      <ItemCount>0</ItemCount>
    </StyledWrapper>
  )
}

export default CartIcon;
